import React from 'react';
import Navbar from '../component/navbar';  // Import Navbar

const Home = () => {
  return (
    <div>
      <Navbar />  
      <div className="home-content">
        <h1>Welcome to our company - Manage employees and equipment easily.</h1>
        <section>
          <h2>Features List Section</h2>
          <p>Overview of managing employees, assigning equipment, and generating reports.</p>
        </section>
        <section>
          <h2>Services Section</h2>
          <p>Details about employee management, equipment tracking, and more.</p>
        </section>
        <section>
          <h2>Testimonial Section</h2>
          <p>Customer testimonials and feedback on our services.</p>
        </section>
      </div>
    </div>
  );
};

export default Home;
